var $ = function(x) { return document.getElementById(x); }


const VISITED    = 1;
const INELIGIBLE = 2;

function CountriesList(features, el, vel, rel) {
  this.store      = {};
  this.features   = features;
  this.mode       = VISITED;
  this.el         = $(el);
  this.vel        = $(vel);
  this.rel        = $(rel);
  this.visited    = {};
  this.ineligible = {};

  this.init();
  this.render();
}
CountriesList.prototype.init = function() {
  for (let i = 0; i < this.features.length; i++) {
    this.store[this.features[i].id] = this.features[i];
  }
  var z;
  try { z = JSON.parse(getCookie("vc")); } catch(e) { z = null; }
  if (Array.isArray(z)) { 
    for (var i=0; i<z.length; i++) {
      this.visited[z[i]] = true;
    }
  }
  try { z = JSON.parse(getCookie("ic")); } catch(e) { z = null; }
  if (Array.isArray(z)) { 
    for (var i=0; i<z.length; i++) {
      this.ineligible[z[i]] = true;
    }
  }
}
CountriesList.prototype.getById = function(id) {
  return this.store[id];
}
CountriesList.prototype.search = function(lat, lng) {
  let match = false;
  let country, coords;

  for (let i = 0; i < this.features.length; i++) {
    country = this.features[i];
    if(country.geometry.type === 'Polygon') {
      match = pointInPolygon(country.geometry.coordinates[0], [lng, lat]);
      if (match) {
        return {
          code: this.features[i].id,
          name: this.features[i].properties.name
        };
      }
    } else if (country.geometry.type === 'MultiPolygon') {
      coords = country.geometry.coordinates;
      for (let j = 0; j < coords.length; j++) {
        match = pointInPolygon(coords[j][0], [lng, lat]);
        if (match) {
          return {
            code: this.features[i].id,
            name: this.features[i].properties.name
          };
        }
      }
    }
  }
  return null;
}
CountriesList.prototype.getCountriesList = function() {
  return Object.keys(this.store);
}
CountriesList.prototype.getVisitedCountriesList = function() {
  var self = this;
  return Object.keys(this.visited).filter(function(x) { return self.visited[x] === true });
}
CountriesList.prototype.getIneligibleCountriesList = function() {
  var self = this;
  return Object.keys(this.ineligible).filter(function(x) { return self.ineligible[x] === true });
}
CountriesList.prototype.getUnvisitedCountriesList = function() {
  var self = this;
  return Object.keys(this.store).filter(function(x) { return self.visited[x] !== true && self.ineligible[x] !== true });
}
CountriesList.prototype.getRandomCountry = function() {
  var xs  = this.getUnvisitedCountriesList();
  var min = 0, max = xs.length-1;
  var i   = Math.round(Math.random() * (max - min) + min);
  var c   = this.getById(xs[i]); 

  return c;
}
CountriesList.prototype.setMode = function(m) { 
  this.mode = m; 
  this.render();
}
CountriesList.prototype.toggleMode = function() { 
  if (this.mode === VISITED) { this.mode = INELIGIBLE; }
  else { this.mode = VISITED; }
  this.render();
}
CountriesList.prototype.markAsVisited = function(country) {
  this.visited[country.id] = true;

  setCookie("vc", JSON.stringify(this.getVisitedCountriesList()));
  setCookie("ic", JSON.stringify(this.getIneligibleCountriesList()));
  this.render();
}
CountriesList.prototype.toggle = function(x) {
  if (this.mode === VISITED) { var v = this.visited; } 
  else { var v = this.ineligible; }

  if (v[x]) { v[x] = !v[x]; } 
  else { v[x] = true; }

  setCookie("vc", JSON.stringify(this.getVisitedCountriesList()));
  setCookie("ic", JSON.stringify(this.getIneligibleCountriesList()));
  this.render();
}
CountriesList.prototype.reset = function(x) {
  if (this.mode === VISITED) { this.visited = {}; } 
  else { this.ineligible = {}; }

  setCookie("vc", JSON.stringify(this.getVisitedCountriesList()));
  setCookie("ic", JSON.stringify(this.getIneligibleCountriesList()));
  this.render();
}
CountriesList.prototype.getSelectedCls = function(x) {
  if      (this.mode === VISITED &&  this.visited[x])    { return "c-visited"; } 
  else if (this.mode === VISITED && !this.visited[x])    { return "c-not-visited"; } 
  else if (this.mode !== VISITED &&  this.ineligible[x]) { return "c-ineligible"; } 
  else                                                   { return "c-not-ineligible"; } 
}
CountriesList.prototype.render = function() {
  var self = this;
  var xs = Object.keys(this.store).sort();
  var h = xs.map(function(x) { 
    var cls = self.getSelectedCls(x); 
    return "<div class='" + cls + "' data-countryid='" + x + "'>"+x+"</div>" 
  });
  var v  = Object.values(this.visited).filter(function(x) { return x}).length;
  var ie = Object.values(this.ineligible).filter(function(x) { return x}).length;
  var r  = Object.values(xs).length - (v + ie);

  if (this.mode === VISITED) {
    $('cl-mode-v').classList.add('mode-ineligible');
    $('cl-mode-i').classList.remove('mode-ineligible');
    $("cl-reset").disabled = v === 0 ? true : false;
  } else {
    $('cl-mode-v').classList.remove('mode-ineligible');
    $('cl-mode-i').classList.add('mode-ineligible');
    $("cl-reset").disabled = ie === 0 ? true : false;
  }
  
  this.el.innerHTML = h.join("");
  this.vel.innerHTML = v;
  this.rel.innerHTML = r;
}

// http://www.ecse.rpi.edu/Homepages/wrf/Research/Short_Notes/pnpoly.html
function pointInPolygon(poly, point) {

  let x = point[0];
  let y = point[1];

  let inside = false, xi, xj, yi, yj, xk;

  for (let i = 0, j = poly.length - 1; i < poly.length; j = i++) {
    xi = poly[i][0];
    yi = poly[i][1];
    xj = poly[j][0];
    yj = poly[j][1];

    xk = ((yi > y) !== (yj > y)) && (x < (xj - xi) * (y - yi) / (yj - yi) + xi);
    if (xk) {
       inside = !inside;
    }
  }

  return inside;
};

function findGeomCenter(country) {
  // WTF XXX coords in the data file are [lon, lat] XXX WTF //
  var findCenter = function(g) {
      var xs = g.map(function(x){ return x[0] });
      var ys = g.map(function(x){ return x[1] });
      var lon = (Math.min(...xs)+Math.max(...xs))/2;
      var lat = (Math.max(...ys)+Math.min(...ys))/2

      return [lat, lon]
  }

  var r;

  if (country.geometry.type == 'Polygon') {
      r = country.geometry.coordinates[0];
  } else if (country.geometry.type == 'MultiPolygon') {
      var gs = country.geometry.coordinates.map(function(x){ return x[0] });
      r = gs.reduce(function(acc, cur){ 
          if (cur.length > acc.length) {
              return cur;
          } else {
              return acc;
          }
      }, []);
  } else {
      throw("findGeomCenter: bad input: ", country.geometry);
  }
  return findCenter(r);
}

function rad2deg(point) {
   var latD = point[0] * 180 / Math.PI;
   var lonD = point[1] * 180 / Math.PI;

   return {x: latD, y: lonD, z: 0};
}

function deg2rad(point) {
  var latR = point[0] * Math.PI / 180,
      lonR = point[1] * Math.PI / 180;

  return {x: latR, y: -Math.PI/2 - lonR, z: 0};
}





var projection = d3.geoEquirectangular()
  .translate([2048, 1024])
  .scale(650);

 function mapTexture(geojson, fgColor, bgColor) {
  var texture, context, canvas;

  canvas = d3.select("body").append("canvas")
    .style("display", "none")
    .attr("width", "4096px")
    .attr("height", "2048px");

  context = canvas.node().getContext("2d");

  var path = d3.geoPath()
    .projection(projection)
    .context(context);

  context.strokeStyle = fgColor; 
  context.lineWidth = 1;
  context.fillStyle = bgColor; 

  context.beginPath();

  path(geojson);

  if (bgColor) {
    context.fill();
  }

  context.stroke();

  // DEBUGGING - Really expensive, disable when done.
  // console.log(canvas.node().toDataURL());

  texture = new THREE.Texture(canvas.node());
  texture.needsUpdate = true;

  canvas.remove();

  return texture;
}

function getCookie(name) {
	var getCookieValues = function(cookie) {
		var cookieArray = cookie.split('=');
		return cookieArray[1].trim();
	};

	var getCookieNames = function(cookie) {
		var cookieArray = cookie.split('=');
		return cookieArray[0].trim();
	};

	var cookies = document.cookie.split(';');
	var cookieValue = cookies.map(getCookieValues)[cookies.map(getCookieNames).indexOf(name)];

	return (cookieValue === undefined) ? null : cookieValue;
};

function setCookie(name, value, days) {
    var expires = "";
    if (days) {
        var date = new Date();
        date.setTime(date.getTime() + (days*24*60*60*1000));
        expires = "; expires=" + date.toUTCString();
    }
    document.cookie = name + "=" + (value || "")  + expires + "; path=/";
}

function deleteCookie(name) {   
    document.cookie = name+'=; Max-Age=-99999999;';  
}function StG() {
    this.spinStops            = 10;
    this.spinDur              = 1000;
    this.restDur              = 500;
    this.rotationDeltaSpin    = 0.25;
    this.rotationDeltaDefault = 0.005;
    this.rotationDelta        = this.rotationDeltaDefault;

    this.winner               = $("winner");
    this.spinner              = $("play");
    this.container            = $("container");
    this.winnerCountry        = null;
    
    this.textureCache;
    this.group;
    this.scene;
    this.camera;
    this.overlay;
    this.renderer;
    this.controls;
}

StG.prototype.getBaseRadius = function () {
    if (window.innerWidth < 900) { return 100 }
    else { return 170; }
}

StG.prototype.init = function () {
    this.camera = new THREE.PerspectiveCamera(60, window.innerWidth / window.innerHeight, 1, 2000);
    this.camera.position.z = 500;

    this.scene = new THREE.Scene();
    this.scene.background = new THREE.Color(0xffffff);
    this.scene.add(new THREE.AmbientLight(0x333333));

    var light = new THREE.DirectionalLight(0xffffff, 1);
    light.position.set(5000,3000,5000);
    this.scene.add(light);

    this.group = new THREE.Group();
    this.scene.add(this.group);

    var earth = new THREE.Mesh(
        new THREE.SphereBufferGeometry(this.getBaseRadius(), 32, 32 ), 
        new THREE.MeshPhongMaterial({
            map:         THREE.ImageUtils.loadTexture('textures/2_no_clouds_4k.jpg'),
            bumpMap:     THREE.ImageUtils.loadTexture('textures/elev_bump_4k.jpg'),
            bumpScale:   0.005,
            specularMap: THREE.ImageUtils.loadTexture('textures/water_4k.png'),
            specular:    new THREE.Color('grey'),
            shininess:   7
        })
    );
    this.group.add(earth);

    var clouds = new THREE.Mesh(
        new THREE.SphereGeometry(this.getBaseRadius()+1, 32, 32),
        new THREE.MeshPhongMaterial({
            map:         THREE.ImageUtils.loadTexture('textures/fair_clouds_4k.png'),
            transparent: true
        })
    );
    this.group.add(clouds);

    this.setBG();

    this.renderer = new THREE.WebGLRenderer();
    this.renderer.setSize(window.innerWidth, window.innerHeight);

    this.container.appendChild(this.renderer.domElement);
    var self = this;
    window.addEventListener('resize', function(ev) { self.onWindowResize() }, false);

}

StG.prototype.setBG = function () {
    // var bg = window.innerWidth >= 1100 ? 'textures/gradientbg.png' : 'textures/bgfull.png'
    var bg = 'textures/bgfull.png';
    this.scene.background = new THREE.TextureLoader().load(bg);
}

StG.prototype.onWindowResize = function () {
    this.camera.aspect = window.innerWidth / window.innerHeight;
    this.camera.updateProjectionMatrix();

    this.renderer.setSize(window.innerWidth, window.innerHeight);
    this.setBG();
}

StG.prototype.togglePause = function (event) {
    if (this.rotationDelta == 0) { 
        this.rotationDelta = this.rotationDeltaDefault;
    } else {
        this.rotationDelta = 0;
    }
}

StG.prototype.highlightCountry = function (country, dur, after) {
    var map = this.textureCache(country.id, '#ff0000', 'rgba(255,0,0,0.2)');
    var self = this;
    
    setTimeout(function() {
        var material = new THREE.MeshPhongMaterial({map: map, transparent: true});
        if (!self.overlay) {
            self.overlay = new THREE.Mesh(
                new THREE.SphereGeometry(self.getBaseRadius()+2, 40, 40), 
                material);
            self.overlay.name = country.id;
            self.group.add(self.overlay);
        } else {
            self.overlay.material = material;
        }
        after();
    }, dur);

    this.flyTo(country, dur);
}

StG.prototype.flyTo = function (country, duration) {
    var latlng     = findGeomCenter(country);
    var targetRot1 = deg2rad(latlng);
    var pos        = this.group.rotation;
    var pi2        = 2 * Math.PI;

    targetRot1 = 
        { y: targetRot1.y + 4 * pi2
        , x: targetRot1.x
        , z: 0 };
    if (targetRot1.y < pos.y) {
        var n = Math.floor(pos.y / pi2);
        targetRot1.y = n * pi2 + targetRot1.y;
    }

    var self = this;
    var tween1 = new TWEEN.Tween(pos).to(targetRot1, duration);
    tween1.onUpdate(function(){ self.group.rotation.setFromVector3(pos) });
    tween1.easing(TWEEN.Easing.Cubic.Out);
    tween1.start();
}

StG.prototype.reset = function(){
    this.hideWinnerTitle();
    this.spinner.disabled = true;
    var self = this;

    var pos = this.group.rotation;
    var target = {x:0,y:0,z:0};

    var tween = new TWEEN.Tween(pos).to(target, 250);
    tween.onUpdate(function(){ self.group.rotation.setFromVector3(pos) });
    tween.easing(TWEEN.Easing.Cubic.Out);
    tween.start();
}
StG.prototype.showWinnerTitle = function(country) {
    this.winner.innerHTML = country.id;
    this.winner.style.display = "block";
}
StG.prototype.hideWinnerTitle = function(country) {
    this.winner.innerHTML = "";
}
StG.prototype.rotateToCountries = function (cs, done) {
    this.hideWinnerTitle();
    var self = this;

    if (cs.length > 1) {
        var country = cs.shift();
        self.showWinnerTitle(country);
        setTimeout(function() { self.rotateToCountries(cs, done) }, self.restDur);
    } else {
        done(cs[0]);
    }
}

StG.prototype.spinTheGlobe = function (cl) {
    this.reset();
    var cs = [];
    var self = this;
    for (var i=0; i<this.spinStops; i++) { cs.push(cl.getRandomCountry()); }
    this.rotationDelta = this.rotationDeltaSpin;

    this.rotateToCountries(cs, function(country) {
        self.winnerCountry = country;
        self.showWinnerTitle(country)
        
        self.highlightCountry(country, self.spinDur, function(){});

        self.rotationDelta = 0;
        self.spinner.disabled = false;
    });
}

StG.prototype.animate = function (time) {
    var self = this;
    requestAnimationFrame(function(){ self.animate() });
    TWEEN.update(time);
    this.render();
}

StG.prototype.render = function () {
    this.camera.lookAt(this.scene.position);
    this.group.rotation.y += this.rotationDelta;
    this.renderer.render(this.scene, this.camera);
}

